INSERT INTO `vl1_MenuModel` (`type`, `menuItemTitle`, `id`, `link`, `modelId`, `treeItemId`, `content`, `r_id`, `lang_id`, `visible`, `pageId`) VALUES
(1, 'Tərəfdaşlar üçün', 445, NULL, 0, 175, '<p><span lang="AZ-LATIN">1. AGClub &uuml;zvlərinə g&uuml;zəştlər təqdim edən istənilən ticarət-servis m&uuml;əssisəsi diskont sisteminin iştirak&ccedil;ısı sayılır.</span></p>\r\n<p><span lang="AZ-LATIN">2. İştirak&ccedil;ı aşağıdakıları etməyə borcludur:</span></p>\r\n<p><span lang="AZ-LATIN">- m&uuml;əyyən edilmiş n&uuml;munəyə uyğun diskont kartı təqdim edildikdə AGClub &uuml;zvlərinə g&uuml;zəştlər etmək;<span class="apple-converted-space">&nbsp;</span><br /> - AGClub &uuml;zvlərini keyfiyyətli məhsul və xidmətlərlə təmin etmək;<span class="apple-converted-space">&nbsp;</span><br /> - xidmətlərin g&ouml;stərilməsi və malların satılması sahəsində m&ouml;vcud qanunvericiliyin, həm&ccedil;inin istehlak&ccedil;ının h&uuml;quqlarının m&uuml;dafiəsi haqqında qanunvericiliyinin tələblərinə riayət etmək.<span class="apple-converted-space">&nbsp;</span></span></p>\r\n<p><span lang="AZ-LATIN">3. İştirak&ccedil;ılar aşağıdakı h&uuml;quqlara malikdirlər:</span></p>\r\n<p><span lang="AZ-LATIN">- &ouml;z m&uuml;əssisəsi haqqında məlumatı AGClub kataloqunda pulsuz yerləşdirmək;<span class="apple-converted-space">&nbsp;</span><br /> - &ouml;z m&uuml;əssisəsinin fəaliyyəti haqqında məlumatı www.localhost/agclub - AGClub saytına pulsuz daxil etmək;<span class="apple-converted-space">&nbsp;</span><br /> - www.localhost/agclub saytında &ouml;z səhifəsini a&ccedil;saq;<span class="apple-converted-space">&nbsp;</span><br /> - k&uuml;tləvi informasiya vasitələrinin AGClub fəaliyyətini işıqlandıran materiallarında pulsuz bildirişlər etmək;<span class="apple-converted-space">&nbsp;</span><br /> - AGClub tərəfindən ke&ccedil;irilən tədbirlərdə iştirak etmək.</span></p>', 73, 'az', 1, 1),
