(1, 'AGClub haqqında', 154, NULL, 0, 78, '<p style="text-align: justify;"><strong>AGClub &ndash; İl boyu Endirimlər!!!</strong><br /><br />Vahid endirim sistemi &uuml;mumi endirim kartı prinsipi əsasında birləşdirilmiş ticarət-servis m&uuml;əssisələrinin şəbəkəsini təmsil edir. AGClub &ouml;z mahiyyətinə g&ouml;rə universaldır, &ccedil;&uuml;nki ən m&uuml;xtəlif tələbat və maraqlara malik olan alıcıların ehtiyaclarını təmin edir. Siz vahid endirim sisteminin &ccedil;oxsaylı partnyorları tərəfindən təqdim olunan g&uuml;zəştlərə satın almaq, istirahət etmək, geyinmək, &ouml;z sağlamlığınızın və xarici g&ouml;r&uuml;n&uuml;ş&uuml;n&uuml;z&uuml;n qeydinə qalmaq, səyahət etmək imkanını əldə edəcəksiniz!!! <br /><br />Klubumuzun məqsədi bankın m&uuml;ştərilərinə m&uuml;xtəlif ticarət, əyləncə və xidmət m&uuml;əssisələrində endirimlər və g&uuml;zəştlər təqdim etməkdir. AGClub endirim sistemi 1 iyun 2004-c&uuml; il tarixindən etibarən fəaliyyət g&ouml;stərir və hal-hazırda Bakı şəhəri ərazisində 330-dan &ccedil;ox obyekti &ouml;z&uuml;ndə birləşdirərək klub &uuml;zvlərinə 40%-qədər endirimlər təqdim edir.<br /><br />İndi Siz partnyorlarımızın təklif etdiyi endirimlərlə yanaşı daimi m&uuml;ştəri statusunu əldə etmək imkanına maliksiniz. Bu status Sizə y&uuml;ksək keyfiyyətli xidmət g&ouml;stərilməsinə zəmanət verir. Bizim partnyorlarımızın sayı daim artır, bu da bizim Sizə etdiyimiz təkliflərin sayını artırır. Biz Sizə şəhərimizin ən yaxşı mağazalarını və m&uuml;əssisələrini təklif edirik!<br /><br />Sistemin əsas məlumat daşıyıcısı daim təzələnən &ldquo;localhost/agclub&rdquo; veb-saytımızdır<br /><br /></p>', 1, 'az', 1, 7),
