(1, 'AGClub endirim kartını necə əldə etmək olar', 442, NULL, 0, 174, '<p><span lang="AZ-LATIN">Bunu etmək &ccedil;ox asandır. Bunun &uuml;&ccedil;&uuml;n AGBankın baş ofisinə və ya filiallarından birinə gəlməli və standart ərizəni doldurmalısınız. Belə ərizə forması b&uuml;t&uuml;n tiplərdən olan kartlar &uuml;&ccedil;&uuml;n praktiki olaraq eynidir: burada pasport məlumatları, telefon, iş yeri, parol və ya a&ccedil;ar s&ouml;z&uuml; və s. g&ouml;stərilir.<span class="apple-converted-space">&nbsp;</span><br /> <br /> AGClub diskont kartı beynəlxalq &ouml;dəmə sistemlərinin (VISA və EuroCard/MasterCard) eyni h&uuml;quqlu plastik kartları dəstinə pulsuz əlavə olunur.</span></p>\r\n<p><span lang="AZ-LATIN">Kartlar dəsti ilə birlikdə Siz əmtəə və xidmətlərə m&uuml;əyyən g&uuml;zəştlər təqdim edən b&uuml;t&uuml;n ticarət-servis m&uuml;əssisələri haqqında informasiya bukletini əldə edəcəksiniz.</span></p>\r\n<p><strong><span lang="AZ-LATIN">Sizi sevimli və h&ouml;rmətli m&uuml;ştərilərimiz sırasında g&ouml;rməyə şad olacağıq!</span></strong></p>', 72, 'az', 1, 1),
