(1, 'AGClub bonus sisteminin üstünlükləri', 433, NULL, 0, 171, '<p>&Ouml;ncə xatırladaq ki, AGBank-ın b&uuml;t&uuml;n kartları, təqa&uuml;d kartları daxil olmaqla (Visa Virtual, MC Virtual kartları istisna olaraq) bonus sisteminə ke&ccedil;irilmişdir.</p>\r\n<p>Bu sistemə əsasən m&uuml;əyyən olunmuş tərəfdaş şəbəkəsində kartla aparılan hər əməliyyatın m&uuml;əyyən faizi x&uuml;susi bonus hesabına yığılır. Bu isə o deməkdir ki, alış-veriş zamanı alınan hər bir malın və ya xidmətin dəyərindən m&uuml;əyyən faiz yenidən bonus şəklində hesaba qayıdır. Əməliyyat məbləğindən hesablanan bonus faizləri hər tərəfdaş &uuml;zrə fərqli olur.</p>\r\n<p>Onu da qeyd edək ki, yığılmış bonuslar AGBonus tərəfdaş şəbəkəsi daxilində m&ouml;vcud olan istənilən ticarət obyektində istifadə oluna bilər. Əməliyyat zamanı yığılmış bonuslardan istifadə m&uuml;ştərinin istəyinə bağlıdır. Ən maraqlısı da odur ki, hesaba yığılan bonuslardan istifadə edərkən onlara g&ouml;rə də yenidən bonus hesablanır.</p>\r\n<p>Bonus hesabını AGBank-ın ATM və POS terminallar vasitəsi ilə yoxlamaq m&uuml;mk&uuml;nd&uuml;r.</p>\r\n<p><a href="http://www.agbank.az/index.php?/az/content/498/"><span style="font-size: medium;">AGBonus tərəfdaşlar siyahısı</span></a></p>\r\n<p>&nbsp;</p>', 69, 'az', 1, 7),
