(1, 'AGClub Gift', 301, NULL, 0, 127, '<ul>\r\n<li><strong>Visa Electron (Gift)<br /><br /></strong>\r\n<ul>\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Azərbaycanda yeganə əvvəlcədən &ouml;dənilən adsız kartıdır. Gift kartı istənilən şəxsə maneəsiz &ouml;t&uuml;r&uuml;lə/hədiyyə edilə bilər. Kartın &uuml;zərində ad yoxdur və bu &ouml;dəniş sistemlərinin qaydalarını pozmur, əksinə bu Prepaid kartı olduğu &uuml;&ccedil;&uuml;n onların icazə isə edilib. Bu kart hədiyyə olduğu &uuml;&ccedil;&uuml;n POS və ATM-dən &ccedil;ıxarılan nağd pullardan komissiya tutulmur. Kartda qalıq 1200 dollardan artıq olmamalıdır.</p>\r\n<p><strong>AGClub Gift</strong> kartı Sizi hədiyyənin se&ccedil;ilməsi problemindən azad edəcək. AGClub Gift kartı istənilən bayrama, nikah, ad g&uuml;n&uuml; və ya sadəcə xoş s&uuml;rpriz kimi &ccedil;ox g&ouml;zəl hədiyyədir.</p>\r\n<p><strong>AGClub Gift</strong> kartı g&ouml;zəl və incə hədiyyədir və Visa Electron loqotipi olan d&uuml;nyada b&uuml;t&uuml;n ticarət mərkəzlərində &ouml;dəniş &uuml;&ccedil;&uuml;n qəbul edilir. O, Sizə hətta hesabda pullar bitdikdən sonra da xidmət edəcək, &ccedil;&uuml;nki kart hesabını artırmaq və kartdan yenə də istifadə etmək olar!</p>\r\n<ul>\r\n<li><strong>AGClub - diskont kartı </strong></li>\r\n</ul>\r\n<p>&nbsp;</p>', 27, 'az', 0, 7),
