(1, 'AGClub Student', 187, NULL, 0, 89, '<table class="pockets-table-3" style="width: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="text-align: center; width: 31%;"><a class="show-result-in-message" title="Isic Maestro" href="javascript:;" data-url="http://localhost/agclub/az/view-page/31">Isic Maestro</a></td>\r\n<td style="text-align: center; width: 4%;">&nbsp;</td>\r\n<td style="text-align: center; width: 30%;"><a class="show-result-in-message" title="MasterCard Virtual" href="javascript:;" data-url="http://localhost/agclub/az/view-page/29">MasterCard Virtual</a></td>\r\n<td style="text-align: center; width: 4%;">&nbsp;</td>\r\n<td style="text-align: center; width: 31%;">AGClub</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 31%;"><a class="show-result-in-message" title="Isic Maestro" href="javascript:;" data-url="http://localhost/agclub/az/view-page/31"><img src="http://localhost/agclub/imagemanager/images/paketler/student.png" alt="" width="200" height="240" /></a></td>\r\n<td style="text-align: center; width: 4%;"><img src="http://localhost/agclub/imagemanager/images/paketler/plus.png" alt="" width="30" height="30" /></td>\r\n<td style="text-align: center; width: 30%;"><a class="show-result-in-message" title="MasterCard Virtual" href="javascript:;" data-url="http://localhost/agclub/az/view-page/29"><img src="http://localhost/agclub/imagemanager/images/paketler/mc_virtual.png" alt="" width="200" height="240" /></a></td>\r\n<td style="text-align: center; width: 4%;"><img src="http://localhost/agclub/imagemanager/images/paketler/plus.png" alt="" width="30" height="30" /></td>\r\n<td style="text-align: center; width: 34%;"><a href="javascript:void(0);"><img src="http://localhost/agclub/imagemanager/images/paketler/agc.png" alt="" width="200" height="240" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="pockets-table-p" style="width: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><img style="float: right;" src="/public/cards-price/price18.png" alt="" /></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 12, 'az', 1, 7),
(1, 'MasterCard Standard', 325, NULL, 0, 135, '<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n<li>avtomobilin icarəsi</li>\r\n</ul>\r\n<p style="text-align: justify;">Bu kartın &ouml;zəlliyi ondandır ki, o, "pay later" kredit kartlar n&ouml;v&uuml;nə aiddir. Bu c&uuml;r kartların sahiblərinə əvvəlcə m&uuml;əyyən ticarət mərkəzlərində m&uuml;əyyən məbləğə xidmət g&ouml;stəriləcək, sonradan isə onlar bu xidmətləri (otellərin rezervasiyası, maşınları icarəsi) &ouml;dəyəcəklər. <br /> Bu kartlar &uuml;&ccedil;&uuml;n nə kolleksiya, nə plastik kartın təcili dəyişdirilməsi, nə də nağd pulların təcili verilməsi nəzərdə tutulmur.</p>', 34, 'az', 0, 7),
(1, 'MasterCard Business', 331, NULL, 0, 137, '<p style="text-align: justify;"><strong>Nağd pulların nəzarəti</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>Daimi nağd pulda ehtiyac olmur</li>\r\n<li>M&uuml;sbət nağd pul axınını yaradır:</li>\r\n</ul>\r\n<ol style="text-align: justify;">\r\n<li>Xidmətlərin &ouml;dənilməsi Business Card hesabının alınmasında əvvəl həyata ke&ccedil;irilə bilər</li>\r\n<li>Business Card-la hesablaşma nağd və ya qəbzlə &ouml;dənişdən sonra həyata ke&ccedil;irilə bilər</li>\r\n</ol>\r\n<ul style="text-align: justify;">\r\n<li>Biznes xərcləri &uuml;zrə &ouml;dənişlər əvvəlcədən tələb olunmur, xərclər Business Card-ın artması ilə bərabər artırlar.</li>\r\n</ul>\r\n<ol style="text-align: justify;">\r\n<li><strong>Sadələşdirilmiş idarəetmə</strong></li>\r\n</ol>\r\n<ul style="text-align: justify;">\r\n<li>Biznes xərcləri və şəxsi xərclər ayrılır</li>\r\n<li>Sadələşdirilmiş bir xətli &ouml;dəniş sistemi təklif olunur</li>\r\n<li>Vaxt və ehtiyatlara qənaət edilir</li>\r\n<li>&Ccedil;oxsaylı qəbzlərin hesablanmasına vaxtın sərfi azaldılır</li>\r\n<li>&Ouml;dənişlər &uuml;&ccedil;&uuml;n imkanların se&ccedil;imi təklif olunur</li>\r\n<li>Partnyorlarla kredit sazişlərinin m&uuml;zakirəsində ehtiyac olmur İlin axırında vergilərin hesablanmasını asanlaşdırır.</li>\r\n</ul>\r\n<ol style="text-align: justify;">\r\n<li><strong>Biznes xərclərinə m&uuml;kəmməl nəzarət</strong></li>\r\n</ol>\r\n<ul style="text-align: justify;">\r\n<li>Kartın sahibi &uuml;&ccedil;&uuml;n vəsaitlərin xərclənməsinə limit qoyulmaqla b&uuml;t&uuml;n xərclər nəzarətə alınır və vəsaitlərin b&uuml;t&uuml;n m&uuml;mk&uuml;n olan icazəsiz istifadəsi məhdudlaşdırılır</li>\r\n<li>Valyutanın konvertasiyası &uuml;&ccedil;&uuml;n əlavə xərclər FX Business Card əmsalları nağd pulun dəyişdirilməsi əmsallarından daha da sərfəli olduğu səbəbindən azalır</li>\r\n<li>BusinessCard xərcləri &uuml;zrə illik hesabatın təhlili vasitəsilə minimal xərclərin nəzarət edilməsi imkan verilir</li>\r\n<li>Xərclər &uuml;zrə aylıq və illik hesabatların təhlili vasitəsilə b&uuml;dcənin hazırlanması prosesi &uuml;&ccedil;&uuml;n dəyərli bir "alətdir"</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Business Card xaricə məzuniyyətə gedən iş&ccedil;ilər &uuml;&ccedil;&uuml;n &ccedil;ox m&uuml;h&uuml;m &uuml;st&uuml;nl&uuml;kləri təklif edir:</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>b&ouml;y&uuml;k məbləğdə nağd pulları &ouml;z&uuml;n&uuml;zlə g&ouml;t&uuml;rməyə ehtiyac olmur</li>\r\n<li>şirkətin xərclərinin &ouml;dənilməsi &uuml;&ccedil;&uuml;n şəxsi kredit kartlarının istifadə edilməsində ehtiyac olmur</li>\r\n<li>d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində qəbul edilir</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>MasterCard Business Card</strong> - Mass kartları (MasterCard-ın parametrləri ilə işləyir)</p>\r\n<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n</ul>\r\n<p style="text-align: justify;">maşının icarəsi qabaqcadan nağd &ouml;dəniş</p>', 36, 'az', 0, 7);
