(1, 'MasterСard World Signia', 355, NULL, 0, 145, '<p style="text-align: justify;">Proqramı sahibinə ekskl&uuml;ziv xidmət təklif edir və praktik olaraq b&uuml;t&uuml;n problemlərin həllində k&ouml;məklik g&ouml;stərir. Kifayətdir ki, kartın &uuml;zərində g&ouml;stərilən telefon n&ouml;mrəsinə zəng edəsiniz və dərhal rus dilli konsyerj xidməti kart sahibinin istənilən problemini həll etməyə yardım&ccedil;ı olar, məsələn elit restoranda masanın sifarişindən və istənilən tədbirlərə biletlərin alınmasından başlayaraq yaxtanın alınmasına və hədiyyələrin &ccedil;atdırılmasınadək.</p>\r\n<p style="text-align: justify;">Bu proqram &ccedil;ər&ccedil;ivəsində <strong>Signia</strong> kart sahibləri &uuml;&ccedil;&uuml;n aşağıdakı &uuml;st&uuml;nl&uuml;klər nəzərdə tutulub:</p>\r\n<ul style="text-align: justify;">\r\n<li>Plastikin təcili olaraq dəyişdirilməsi (itirmə/oğurluq hallarında)</li>\r\n<li>Nəğd vəsaitlərin verilməsi (kartın itirmə/oğurluq hallarında)</li>\r\n<li>Alınmış əşyaların qorunması (itirmə/oğurluq hallarında vəsaitin &ouml;dənilməsi) kart vasitəsi ilə alınmış malın dəyərinin &ouml;dənilməsini nəzərdə tutur</li>\r\n<li>Kart vasitəsi ilə alınmış malın zəmanət m&uuml;ddətinin artırılması, malın alınması vaxtından 24 ay m&uuml;ddətinə əlavə zəmanət avtomatik əldə olunur</li>\r\n<li>Biletlərin/mehmanxanaların qabaqcadan saxlanması və səyahətlər haqqında məlumatlar</li>\r\n<li>Avtomobillərin icarəyə g&ouml;t&uuml;r&uuml;lməsi</li>\r\n<li>S&uuml;r&uuml;c&uuml; ilə təmin olunması</li>\r\n<li>Hava limanında qarşılama</li>\r\n<li>Tərc&uuml;mə&ccedil;i ilə təmin olunması</li>\r\n<li>İstənilən tədbirlərə biletlərin təqdim olunması</li>\r\n<li>Hədiyyələrin &ccedil;atdırılması</li>\r\n<li>Məktubların &ccedil;atdırılması</li>\r\n<li>Hava limanında lonjda olmaq imkanının yaradılması - Priority Pass</li>\r\n</ul>\r\n<p style="text-align: justify;">Təsir bağışlayan sığorta, aşağıda g&ouml;stərilən halları təmin edir:</p>\r\n<ul style="text-align: justify;">\r\n<li>səyahət zamanı hadisə - 500 Avroyadək</li>\r\n<li>tibbi xərclər - 7,5 mln. adambaşına 1 səyahət &uuml;&ccedil;&uuml;n</li>\r\n<li>gecikmiş/itirilmiş baqaj - 500 Avroyadək (gecikmə 4 saat olarsa), 3750 Avro (gecikmə 48 saat olarsa)</li>\r\n<li>gecikdirilmiş/buraxılmış reys - 350 Avroyadək 4 saatdan sonra</li>\r\n<li>buraxılmış u&ccedil;uş - 750 Avroyadək 4 saatdan sonra (əgər diqər alternativ reys olmasa)</li>\r\n<li>səyahətin ləğv edilməsi - 1 870 Avroyadək 1 səyahət &uuml;&ccedil;&uuml;n</li>\r\n<li>alınmış malın qorunması - 3000-dək 1 hadisə &uuml;&ccedil;&uuml;n/maksimum 300 000 karta 1 ilə</li>\r\n<li>əmlaka zərərin vurulması - 50 000-dək 1 iddia &uuml;&ccedil;&uuml;n</li>\r\n<li>şəxsi əşyaların itirilməsi/zədələnməsi - 4 370 Avroyadək 1 səyahət &uuml;&ccedil;&uuml;n</li>\r\n<li>3-c&uuml; tərəfin məsuliyyətsizliyi &uuml;z&uuml;ndən zərər - 1 500 000 Avro</li>\r\n</ul>\r\n<p style="text-align: justify;">а&ccedil;arın itirilməsi - 250 Avroyadək 1 iddia &uuml;&ccedil;&uuml;n (Avtomobil a&ccedil;arının dəyişdirilməsi = g&uuml;ndə 24 saat)</p>', 44, 'az', 0, 7),
(1, 'MasterCard Gold', 337, NULL, 0, 139, '<p style="text-align: justify;">Gold tipli &ouml;dəniş kartları Premium kartlar n&ouml;v&uuml;nə aiddirlər. Bu c&uuml;r kartlar təkcə geniş &ccedil;eşidli əlavə xidmətlər, y&uuml;ksək səviyyəli xidmət və komfort deyil, bu həm&ccedil;inin cəmiyyətdə y&uuml;ksək status və m&ouml;vqenin sahibi olmaq deməkdir.</p>\r\n<p style="text-align: justify;"><strong>MasterCard Gold </strong>kartlarının sahibləri y&uuml;ksək səviyyəli xidmətdən başqa d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində (otel və turizm agentliklərində) b&ouml;y&uuml;k g&uuml;zəştlər, həm&ccedil;inin bir sıra əlavə xidmət və imkanları əldə edirlər.</p>\r\n<p style="text-align: justify;"><strong>MasterCard Gold - Premium kartları</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n<li>avtomobilin icarəsi</li>\r\n<li>x&uuml;susi g&uuml;zəştlər sistemi - Platinum Collection (mağazalar, restoranlar, otellər, əyləncələr)</li>\r\n</ul>\r\n<p style="text-align: justify;">Bu kartın &ouml;zəlliyi ondandır ki, o, "pay later" kredit kartlar n&ouml;v&uuml;nə aiddir. Bu c&uuml;r kartların sahiblərinə əvvəlcə m&uuml;əyyən ticarət mərkəzlərində m&uuml;əyyən məbləğə xidmət g&ouml;stəriləcək, sonradan isə onlar bu xidmətləri (otellərin rezervasiyası, maşınları icarəsi) &ouml;dəyəcəklər.</p>\r\n<p style="text-align: justify;">Bundan əlavə Gold kartlarının sahibləri &uuml;&ccedil;&uuml;n həm&ccedil;inin "<strong>qızıl kolleksiya</strong>" da m&ouml;vcuddur. Bu kolleksiya sadəcə Gold kartla &ouml;dəniş edərək g&uuml;zəştlər verən ticarət mərkəzlərinin siyahısıdır. B&uuml;t&uuml;n bu kolleksiyalar hər il yenilənirlər və bizim saytımızda əks olunurlar.</p>', 38, 'az', 0, 7),
(1, 'Maestro (student)', 316, NULL, 0, 132, '<ul>\r\n<li>identifikasiyalıdır - tələbənin beynəlxalq vəsiqəsidir</li>\r\n<li>diskontlu (g&uuml;zəştlidir) - d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində həm avia biletlərin alınması, həm də m&uuml;xtəlif mağaza, restoran və muzeylərdə g&uuml;zəştlər təklif olunur</li>\r\n</ul>\r\n<p><strong>ISIC/ITIC nədir?</strong></p>\r\n<ul>\r\n<li>ISIC - b&uuml;t&uuml;n d&uuml;nyada tanınan beynəlxalq rəsmi tələbə vəsiqəsidir;</li>\r\n<li>ITIC - b&uuml;t&uuml;n d&uuml;nyada tanınan beynəlxalq rəsmi m&uuml;əllim vəsiqəsidir;</li>\r\n<li>ISIC Beynəlxalq Tələbə Səyahət&ccedil;ilər Konfederasiyası (ISTC) tərəfindən yayılır;</li>\r\n<li>ISIC - beynəlxalq tələbə vəsiqəsi 30 il bundan əvvəl UNESKO-nun dəstəyi ilə yaradılmışdır;</li>\r\n<li>Hal-hazırda ISIC/ITIC d&uuml;nyanın 106 &ouml;lkəsində tanınır və yaşamağa, qidalanmağa, m&uuml;xtəlif nəqliyyat vasitələri ilə hərəkət edilməyə g&ouml;rə g&uuml;zəştlər təmin strukturların sayı 250 mindən &ccedil;oxdur;</li>\r\n<li>Kartın yaradılmasının əsas ideyası ondur ki, tələbələrə və gənclərə səyahətlər zamanı, xaricdə təhsil alarkən vəsaitlərə qənaət etmək və həm&ccedil;inin &ouml;z vətənlərində və d&uuml;nyanın 106-dan &ccedil;ox &ouml;lkəsində lisenziyalı ofislər sistemi vasitəsilə beynəlxalq g&uuml;zəşt sisteminə daxil olmaq imkanları verilsin;</li>\r\n<li>ISIC Help Desk x&uuml;susi xidmət vasitəsilə kart sahibləri gecə-g&uuml;nd&uuml;z xidmət g&ouml;stərilir;</li>\r\n<li>Telefon kartın &uuml;zərində g&ouml;stərilib.</li>\r\n</ul>', 31, 'az', 0, 7),
