(1, 'Visa Classic', 328, NULL, 0, 136, '<p style="text-align: justify;">Bankomatlar, po&ccedil;t və telefonla xidmət və malları təklif edən real və virtual mağazalar daxil olmaqla d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində Visa loqotipi ilə işarələnmiş istənilən ticarət mərkəzlərində qəbul edilən universal &ouml;dəniş alətidir.</p>\r\n<p style="text-align: justify;"><strong>VISA CLASSIC - Mass kartı</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n<li>avtomobilin icarəsi</li>\r\n</ul>\r\n<p style="text-align: justify;">Bu kartlar "pay later" kredit kartlar n&ouml;v&uuml;nə aiddir. Bu c&uuml;r kartların sahiblərinə əvvəlcə m&uuml;əyyən ticarət mərkəzlərində m&uuml;əyyən məbləğə xidmət g&ouml;stəriləcək, sonradan isə onlar bu xidmətləri (otellərin rezervasiyası, maşınları icarəsi) &ouml;dəyəcəklər.</p>\r\n<p style="text-align: justify;">Bu kartlar &uuml;&ccedil;&uuml;n nə kolleksiya, nə plastik kartın təcili dəyişdirilməsi, nə də nağd pulların təcili verilməsi nəzərdə tutulmur.</p>', 35, 'az', 0, 7),
