(1, 'Visa Business', 334, NULL, 0, 138, '<p style="text-align: justify;"><strong>Nağd pulların nəzarəti</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>Daimi nağd pulda ehtiyac olmur</li>\r\n<li>M&uuml;sbət nağd pul axınını yaradır:</li>\r\n</ul>\r\n<ol style="text-align: justify;">\r\n<li>Xidmətlərin &ouml;dənilməsi Business Card hesabının alınmasında əvvəl həyata ke&ccedil;irilə bilər;</li>\r\n<li>Business Card-la hesablaşma nağd və ya qəbzlə &ouml;dənişdən sonra həyata ke&ccedil;irilə bilər;</li>\r\n</ol>\r\n<ul style="text-align: justify;">\r\n<li>Biznes xərcləri &uuml;zrə &ouml;dənişlər əvvəlcədən tələb olunmur, xərclər Business Card-ın artması ilə bərabər artırlar.</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Sadələşdirilmiş idarəetmə</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>Biznes xərcləri və şəxsi xərclər ayrılır</li>\r\n<li>Sadələşdirilmiş bir xətli &ouml;dəniş sistemi təklif olunur</li>\r\n<li>Vaxt və ehtiyatlara qənaət edilir</li>\r\n<li>&Ccedil;oxsaylı qəbzlərin hesablanmasına vaxtın sərfi azaldılır</li>\r\n<li>&Ouml;dənişlər &uuml;&ccedil;&uuml;n imkanların se&ccedil;imi təklif olunur</li>\r\n<li>Partnyorlarla kredit sazişlərinin m&uuml;zakirəsində ehtiyac olmur</li>\r\n<li>İlin axırında vergilərin hesablanmasını asanlaşdırır.</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Biznes xərclərinə m&uuml;kəmməl</strong><strong>nəzarət</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>Kartın sahibi &uuml;&ccedil;&uuml;n vəsaitlərin xərclənməsinə limit qoyulmaqla b&uuml;t&uuml;n xərclər nəzarətə alınır və vəsaitlərin icazəsiz istifadəsi məhdudlaşdırılır</li>\r\n<li>Valyutanın konvertasiyası &uuml;&ccedil;&uuml;n əlavə xərclər FX Business Card əmsalları nağd pulun dəyişdirilməsi əmsallarından daha da sərfəli olduğu səbəbindən azalır</li>\r\n<li>BusinessCard xərcləri &uuml;zrə illik hesabatın təhlili vasitəsilə minimal xərclərin nəzarət edilməsi imkan verilir</li>\r\n<li>Xərclər &uuml;zrə aylıq və illik hesabatların təhlili vasitəsilə b&uuml;dcənin hazırlanması prosesi &uuml;&ccedil;&uuml;n dəyərli bir "alətdir"</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Business Card xaricə məzuniyyətə gedən iş&ccedil;ilər &uuml;&ccedil;&uuml;n &ccedil;ox m&uuml;h&uuml;m &uuml;st&uuml;nl&uuml;kləri təklif edir:</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>b&ouml;y&uuml;k məbləğdə nağd pulları &ouml;z&uuml;n&uuml;zlə g&ouml;t&uuml;rməyə ehtiyac olmur</li>\r\n<li>şirkətin xərclərinin &ouml;dənilməsi &uuml;&ccedil;&uuml;n şəxsi kredit kartlarının istifadə edilməsində ehtiyac olmur</li>\r\n<li>d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində qəbul edilir</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Visa Business Card - Mass kartları (Visa Classic kartının parametrləri ilə işləyir)</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n</ul>\r\n<p style="text-align: justify;">maşının icarəsi</p>', 37, 'az', 0, 7),
