(1, 'Visa Gold', 340, NULL, 0, 140, '<p style="text-align: justify;">Premium kartlarıdır və &ouml;z sahiblərinə y&uuml;ksək keyfiyyətli xidmət təmin edirlər. Premium klassına aid olan Gold kateqoriyalı &ouml;dəniş kartları təkcə geniş &ccedil;eşidli əlavə xidmətlər, y&uuml;ksək səviyyəli xidmət və komfort deyil, bu həm&ccedil;inin cəmiyyətdə y&uuml;ksək status və m&ouml;vqenin sahibi olmaq deməkdir.</p>\r\n<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>otelin rezervasiyası</li>\r\n<li>avtomobilin icarəsi</li>\r\n<li>x&uuml;susi g&uuml;zəştlər sistemi - Platinum Collection (mağazalar, restoranlar, otellər, əyləncələr)</li>\r\n</ul>\r\n<p style="text-align: justify;">Bu kartın &ouml;zəlliyi ondandır ki, o, "pay later" kredit kartlar n&ouml;v&uuml;nə aiddir. Bu c&uuml;r kartların sahiblərinə əvvəlcə m&uuml;əyyən ticarət mərkəzlərində m&uuml;əyyən məbləğə xidmət g&ouml;stəriləcək, sonradan isə onlar bu xidmətləri (otellərin rezervasiyası, maşınları icarəsi) &ouml;dəyəcəklər. <br /> Bundan əlavə Gold kartlarının sahibləri &uuml;&ccedil;&uuml;n həm&ccedil;inin "qızıl kolleksiya" da m&ouml;vcuddur. Bu kolleksiya sadəcə Gold kartı ilə &ouml;dəniş edərək g&uuml;zəştlər verən ticarət mərkəzlərinin siyahısıdır. B&uuml;t&uuml;n bu kolleksiyalar hər il yenilənirlər və bizim saytımızda əks olunurlar.</p>', 39, 'az', 0, 7),
