r/images/paketler/priority%20pass.png" alt="" width="200" height="240" /></a></td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 31%;"><a class="show-result-in-message" title="IAPA" href="javascript:;" data-url="http://localhost/agclub/az/view-page/43">IAPA</a></td>\r\n<td style="text-align: center; width: 4%;">&nbsp;</td>\r\n<td style="text-align: center; width: 30%;">Sigorta karti</td>\r\n<td style="text-align: center; width: 4%;">&nbsp;</td>\r\n<td style="text-align: center; width: 31%;">AGClub</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center; width: 31%;"><a class="show-result-in-message" title="IAPA" href="javascript:;" data-url="http://localhost/agclub/az/view-page/43"><img src="http://localhost/agclub/imagemanager/images/paketler/IAPA.png" alt="" width="200" height="240" /></a></td>\r\n<td style="text-align: center; width: 4%;"><img src="http://localhost/agclub/imagemanager/images/paketler/plus.png" alt="" width="30" height="30" /></td>\r\n<td style="text-align: center; width: 30%;">&nbsp;<img src="http://localhost/agclub/imagemanager/images/paketler/sigorta.png" alt="" width="200" height="240" /></td>\r\n<td style="text-align: center; width: 4%;"><img src="http://localhost/agclub/imagemanager/images/paketler/plus.png" alt="" width="30" height="30" /></td>\r\n<td style="text-align: center; width: 31%;"><a href="javascript:void(0);"><img src="http://localhost/agclub/imagemanager/images/paketler/agc.png" alt="" width="200" height="240" /></a>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="pockets-table-p" style="width: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><img style="float: right;" src="/public/cards-price/price160.png" alt="" /></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 18, 'az', 1, 7),
(1, 'Visa Platinum', 343, NULL, 0, 141, '<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n<li>kartın təcili dəyişdirilməsi və/və ya kartın itirildiyi halda pulların verilməsi</li>\r\n<li>konsyerj və katiblik xidmətləri</li>\r\n<li>ailə &uuml;zv&uuml; &uuml;&ccedil;&uuml;n bu kateqoriyalı əlavə kartın a&ccedil;ılması</li>\r\n<li>tibbi və yol xərclərinin sığortası</li>\r\n<li>otelin rezervasiyası</li>\r\n<li>avtomobilin icarəsi</li>\r\n<li>x&uuml;susi g&uuml;zəştlər sistemi - Platinum Collection (mağazalar, restoranlar, otellər, əyləncələr)</li>\r\n</ul>\r\n<p style="text-align: justify;">Platinum konsyerj xidməti - otellər, bilet, restoran, maşınların rezervasiyası və &uuml;mumiyyətlə lazımi məlumatın alınması xidmətidir. Bu xidmətləri Platinum kartın m&uuml;ştərisi x&uuml;susi pulsuz n&ouml;mrəyə zəng etməklə əldə edə bilər. Platinum Collection - adamı heyran edir. Bundan əlavə bankımızı Platinum kartlarının sahibləri Priority Pass (hava limanlarında lonjara daxil olma) və IAPA (otellerdə, maşınların icarəsində və restoranlarda g&uuml;zəştlərin və y&uuml;k&uuml;n və a&ccedil;arların itirilməsindən m&uuml;dafiənin təmin edilməsi) kartlarının da sahibləri olurlar. <br /> <br /> AGBankın Visa plastik kartı &ccedil;iplidir. Bu deməkdir ki, sizin hesabınız icazə verilməmiş xərclərdən etibarlı m&uuml;dafiə olunur.</p>\r\n<p style="text-align: justify;"><strong>Plastik kartın &uuml;st&uuml;nl&uuml;kləri</strong></p>\r\n<p style="text-align: justify;">Plastik kart həyatın əsl qiymətini bilənlər, istirahət və səyahətlərə pul xərclənməyə &ccedil;əkinməyənlər &uuml;&ccedil;&uuml;n bir məhsuldur. Plastik kart Sizə etibarlıq, komfort, təhl&uuml;kəsizlik, xoş s&uuml;rprizlər və x&uuml;susi xidməti təmin edəcək. 24 saat ərzində Visa sizin xidmətinizdədir. Onun istənilən pulsuz n&ouml;mrəsinə zəng etməklə Siz:</p>\r\n<ul style="text-align: justify;">\r\n<li>Azərbaycandan kənarda kartın itirilməsi/oğrulanması barədə xəbər verə bilərsiniz</li>\r\n<li>M&uuml;vəqqəti kartı ala bilərsiniz - əgər kartınız xaricdə itirilib/oğurlanıbsa kartın n&ouml;mrəsi he&ccedil; lazım olmayacaq, sadəcə &ouml;z adınızı və bank-emitentin adını deyərək MCGS-lə əlaqə yaratmaq kifayətdir. Olduğunuz yerdən asılı olaraq 1-2 iş g&uuml;n&uuml; ərzində Siz x&uuml;susi po&ccedil;tla və ya d&uuml;nyanın b&uuml;t&uuml;n &ouml;lkələrində yerləşən istənilən 37 mərkəzlərdən birində m&uuml;vəqqəti kartınızı ala bilərsiniz</li>\r\n<li>Əgər kartınız itirilib/oğurlanıbsa Siz təcili nağd pulun verilməsi &uuml;&ccedil;&uuml;n m&uuml;raciət edə bilərsiniz. Bunun &uuml;&ccedil;&uuml;n MCGS-lə əlaqə yaratmaq və nağd pulun alınması &uuml;&ccedil;&uuml;n ən əlverişli yeri (b&uuml;t&uuml;n d&uuml;nya &ouml;lkələrində 50 000 məntəqə) m&uuml;əyyən etmək kifayət edir. Nağd pullar olduğunuz yerdən asılı olaraq 12 və ya 24 saat ərzində təmin olunacaqlar</li>\r\n<li>Balansınızı &ouml;yrənə bilərsiniz</li>\r\n</ul>\r\n<p style="text-align: justify;">Bundan əlavə biz kartların istifadəsində qeydinizə qalmışıq ki,</p>\r\n<ul style="text-align: justify;">\r\n<li>Siz hətta yaranan bəzi texniki problemlərə (Platinum kartlarının x&uuml;susi parametrləri hətta Qızıl kartın analoji parametrlərindən &uuml;st&uuml;nd&uuml;r) baxmayaraq kartdan istifadə edə bilərsiniz</li>\r\n<li>B&uuml;t&uuml;n d&uuml;nya &ouml;lkələrinin ən iri hava limanlarında yerləşəm VIP lonjlarına Siz Priority Pass vasitəsilə daxil ola bilərsiniz</li>\r\n<li>Bizim sayta yerləşən və hər il yenilənən Visa Platinim Kolleksiyasından istifadə edə və g&uuml;zəşt və hədiyyələr ala bilərsiniz</li>\r\n</ul>', 40, 'az', 0, 7),
