(1, 'Priority Pass - diskont kartı', 349, NULL, 0, 143, '<p style="text-align: justify;">Priority Pass - b&uuml;t&uuml;n d&uuml;nyada birinci dərəcəli zallara daxil olmaq &uuml;&ccedil;&uuml;n Sizin "Buraxılış vəsiqənizdir".</p>\r\n<p style="text-align: justify;">G&ouml;r&uuml;n Priority Pass Sizə nələri təqdim edə bilər:<br /> &bull; B&uuml;t&uuml;n d&uuml;nyada 90 beynəlxalqhava limanında 200-dən &ccedil;ox birinci dərəcəli zalda rahatlıq və sakitlik <br /> &bull; Aviabiletin dərəcəsindən asılı olmayaraq, Sizin hər səyahətiniz zamanı - hətta ən qısa səfərlərdə - harada yerləşirlərsə yerləşsinlər, b&uuml;t&uuml;n birinci dərəcəli zallara daxil olmaq imkanı <br /> &bull; Dincəlmək, sənədlərlə işləmək, qəlyənaltı etmək və ya g&ouml;zlənilməyən gecikmə, yaxud reys ləğv edildiyi hallarda g&ouml;r&uuml;ş&uuml;n vaxtını dəyişdirmək imkanı <br /> &bull; Sakit, rahat şəraitdə telefon və ya faks kimi biznes-xidmətlərdən istifadə etmək imkanı <br /> &bull; Qonaqlarınız &uuml;&ccedil;&uuml;n birinci dərəcəli zalların x&uuml;susi &uuml;st&uuml;nl&uuml;klərindən istifadə etmək imkanı <br /> &bull; Yerli valyutanın alınmasına ehtiyacın olmaması</p>\r\n<p style="text-align: justify;">Siz və Sizin istənilən qonağınız proqramda iştirak edən zaldan istifadə etmək istədiyiniz zaman &ouml;z Priority Pass kartınızı sadəcə olaraq təqdim edin və Sizə dərhal zaldan istifadə etmək imkanı veriləcəkdir. Zalda kartınızın surəti &ccedil;ıxarılacaq və məxaric orderini imzalamaq Sizdən xahiş olunacaqdır. Sizin və Sizi m&uuml;şaiyət edən hər bir şəxsin zala gəlməsinə g&ouml;rə haqq hər ayın sonunda Sizin g&ouml;stərdiyiniz kredit kartından tutulacaqdır. Zala daxil olma haqqı, zaldan asılı olaraq 24-30 ABŞ Dolları təşkil edir.Sizi muşaiyət edən Şəxsin zala daxil olma haqqı 24-30 ABŞ Dolları təşkil edir. &Uuml;mumi məbləğ kart &uuml;zrə &ouml;dəmə haqqında aylıq xəbərdarlıqda əks etdiriləcəkdir.</p>\r\n<p style="text-align: justify;">Zalda olarkən Siz telefon, faks və pulsuz i&ccedil;kilər kimi istənilən xidmətdən sərbəst istifadə edə bilərsiniz. Hətta bəzi zallarda danışıqlar aparmaqdan &ouml;tr&uuml; lazım olan hər şərait Sizin &uuml;&ccedil;&uuml;n yaradılacaqdır. Zalda Siz hava limanının səs-k&uuml;y&uuml;ndə uzaqda sakitlik və rahatlıqla dincəlmək &uuml;&ccedil;&uuml;n ideal şərait tapacaq və &ouml;z reysinizi g&ouml;zləyərək səyahətinizə sakitcə hazırlaşacaqsınız.</p>', 42, 'az', 0, 7),
