(1, 'IAPA', 352, NULL, 0, 144, '<p style="text-align: justify;">IAPA iş adamları &uuml;&ccedil;&uuml;n diskont kart və m&ouml;təbərlik və ləyaqətlik rəmzidir. Onun təqdim etdiyi g&uuml;zəştlər kifayət qədər y&uuml;ksək səviyyəli m&uuml;əssisələrdə həyata ke&ccedil;irilir. D&uuml;nyanın IAPA ilə işləyən 12000 mehmanxanasından ITT Sheraton, Leading hotels of the World, Hilton, Marriott, Golden Tulip adlarını &ccedil;əkmək olar. IAPA kartları ilə Hertz, Avis, National, Eurocar və ya Tilden-də avtomobillərin icarəsi zamanı standart və hətta x&uuml;susi tariflərdən 30 faizədək qənaət etmək olar - kirayə bəndlərinin sayı 10000-dən &ccedil;oxdur. IAPA siyasi və işg&uuml;zar elita &uuml;&ccedil;&uuml;n nəzərdə tutulur və adi g&uuml;zəşt və xidmətlərlə yanaşı sığorta və servis &uuml;zrə nadir sxem təqdim edir. X&uuml;susilə, IAPA g&uuml;zəştləri &uuml;zrə məlumat kitab&ccedil;asından istifadə etdikdə "Səyahətlər xidməti" vasitəsilə mehmanxanada n&ouml;mrə, avtomobil və aviabileti pulsuz sifariş etmək olar (Free Hotel and Car Rental Reservations). Bu halda m&uuml;əyyən qədər mil yığılır və sonradan onu pulsuz u&ccedil;uşla əvəz etmək olar. Azərbaycanda əsasən "assosiativ" &uuml;zvlər &uuml;&ccedil;&uuml;n IAPA kartaları geniş yayılmışdır. Assosiativ &uuml;zvl&uuml;k &ccedil;ər&ccedil;ivəsində servis xidmətləri sırasında baqacın oricinal axtarılması sistemi m&ouml;vcuddur (Bag-Guard). O, xaricdə beynəlxalq hava limanları zonasında itmiş baqacın x&uuml;susi cetonlar və nişanlar vasitəsi ilə iki sutka ərzində axtarılıb tapılması və qaytarılmasına imkan verir və baş vermiş hadisələrin 95 faizi uğurla nəticələnir. Bu sistem kart sahiblərinin a&ccedil;arlarının (Key- Guard) və aviabiletlərinin (Ticket- Guard) qorunması &uuml;&ccedil;&uuml;n də m&ouml;vcuddur. Tam h&uuml;quqlu IAPA &uuml;zvlərinə Priority Pass proqramı (bahadır və ondan hamı istifadə edə bilmir) - d&uuml;nyanın 80 hava limanında birinci dərəcəli və biznes klass zallarının xidmətlərindən xeyli g&uuml;zəştlə istifadə etmək imkanı təklif olunur. Onlar b&uuml;t&uuml;n aviaşirkətlərin m&uuml;təmadi reysləri ilə u&ccedil;uş zamanı baş vermiş bədbəxt hadisələrə g&ouml;rə 500 min ABŞ dolları, &ccedil;arter reysləri ilə u&ccedil;uş zamanı baş vermiş bədbəxt hadisələrə g&ouml;rə 200 min ABŞ dolları və istənilən digər nəqliyyat vasitəsilə səfər zamanı baş vermiş bədbəxt hadisələrə g&ouml;rə 50 min ABŞ dolları məbləğində sığorta ala bilərlər. Tam h&uuml;quqlu IAPA &uuml;zvləri &uuml;&ccedil;&uuml;n həm&ccedil;inin itirilmiş aviabiletlər bərpa olunur və IAPA-dan teleks əsasında yaxınlıqda yerləşən bank tərəfindən 400 ABŞ dolları məbləğində ikihəftəlik faizsiz kredit təqdim edilir (kredit kartı itirildiyi halda). Həm&ccedil;inin ən azı iki beynəlxalq &ouml;dəmə sistemi kartına sahib olanlar IAPA-ya daxil olarkən CPP kredit kartlarının m&uuml;dafiəsi proqramında pulsuz qeydiyyata alınırlar. Bu itirilmiş və ya oğurlanmış kartların vaxtında "qara siyahıya" salınmasını və sanksiyasız ilk 500 dolların sığorta olunmasını təmin edir. IAPA &uuml;zrə b&uuml;t&uuml;n tiplərdən olan kartlar bir il fəaliyyət m&uuml;ddəti ilə məhdudlaşdırılır. Tam h&uuml;quqlu &uuml;zv xidmətlərdən istifadə edərək onlardan narazı qalarsa, 90 g&uuml;n ərzində kartı qaytara və onun dəyərini geri ala bilər. Bu halda o yenidən IAPA &uuml;zv&uuml; olmaq h&uuml;ququnu itirir. İllik &ouml;dəmədən başqa IAPA daxil olarkən 200 ABŞ dolları məbləğində qeydiyyat haqqı &ouml;dənilməlidir. Kart bank vasitəsilə alındıqda bu &ouml;dənişə ehtiyac olmur. Əgər Siz işlə bağlı tez-tez u&ccedil;an biznesmen deyilsinizhsə, bu şirkətin kartı aylıq xərclər zamanı 1000 ABŞ dollarından az olmamaqla və xaricdə m&uuml;ntəzəm istirahət vaxtı real qənaətə imkan yaradacaqdır.</p>', 43, 'az', 0, 7),
