(1, 'Visa Infinite', 358, NULL, 0, 146, '<p style="text-align: justify;">Bu proqrama g&ouml;rə Visa Infinite kart istifadə&ccedil;iləri &uuml;&ccedil;&uuml;n aşağıdakı imtiyazlar tanınır:</p>\r\n<ul>\r\n<li style="text-align: justify;">İri xərcləmələrin sərbəst aparılması imkanı;</li>\r\n<li style="text-align: justify;">Konsyerj xidməti: səyahətlərin təşkilində k&ouml;məklik, təyyarə biletlərinin, mehmanxanaların bronlaşdırılmas, mədəni-k&uuml;tləvi və idman tədbirlərinə biletlərin alınması, sənədlərin, hədiyyələrin və bir &ccedil;ox şeyin &ccedil;atdırılması;</li>\r\n<li style="text-align: justify;">24 saat xidmət g&ouml;stərən Visa kart istifadə&ccedil;ilərinə dəstək servisi &mdash; məlumatlandırılma, itirilmiş kartların bağlanması, kartın təcili dəyişdirilməsi və ya kartın itirilməsi ya da oğurlanması halında təcili olaraq nağd pulun &ccedil;atdırılması;</li>\r\n<li style="text-align: justify;">Telefonla tibbi və h&uuml;quqi məsləhətlər;</li>\r\n<li style="text-align: justify;">Səyahətlər zamanı baş verəcək bədbəxt hadisələrdən 1 000 000 ABŞ dollarına qədər sığortalanma;</li>\r\n<li style="text-align: justify;">B&uuml;t&uuml;n d&uuml;nya &uuml;zrə ticarət-iaşə obyektlərində ekskl&uuml;ziv xidmət səviyyəsi;</li>\r\n<li style="text-align: justify;">Alınmış malların itirilməsi halında, &ldquo;malların qorunması&rdquo; proqramı &uuml;zrə itirilmiş malın qiymətinin qaytarılması;</li>\r\n</ul>\r\n<p style="text-align: justify;">Kartla alınmış malların zəmanət m&uuml;ddətinin 2 ilə qədər artırılmasını təmin edən zəmanətlərin genişləndirilməsi proqramı.</p>', 45, 'az', 0, 7),
