(1, 'AGClub Endirim kartlarının üstünlükləri', 439, NULL, 0, 173, '<p><span lang="AZ-LATIN">AGBank Azərbaycan plastic kartlar bazarında lider olaraq MasterCard və Visa beynəlxalq &ouml;dəmə sistemlərin emitentidir. AGBank fəaliyyətinin əsas məqsədi yeni texnologiyalar və biznes proseslər vasitəsilə xidmət səviyyəsini d&uuml;nya standartlarına &ccedil;atdirmaq və m&uuml;ştərilərinə y&uuml;ksək səviyyəli m&uuml;asir bank məhsulları və xidmətləri təklif etməkdən ibarətdir.</span></p>\r\n<p><span lang="AZ-LATIN">Plastik kart sahiblərinin rahatlığını təmin etmək &uuml;&ccedil;&uuml;n AGBank Azərbaycanda analoqu olmayan AGClub plastic kartlar komplektlərini yaratmışdır.</span></p>\r\n<p><span lang="AZ-LATIN">AGBank plastik kartların&nbsp; satışı ilə məşğul olmur, kompleks xidmətlər şəklində ekskl&uuml;ziv&nbsp; və &ccedil;oxfunksiyalı məhsullar təklif edir. Hazırda AGBank m&uuml;ştərilərinə 11 plastik kart komplekt təklif&nbsp; edir və onların hər birinə AGClub endirim kartı daxildir. AGClub Premium, AGClub Platinum,AGClub Gold ,AGClub Standard, AGClub Business və AGClub Euro kartlarını sahibləri &uuml;&ccedil;&uuml;n həm&ccedil;ini pulsuz sığorta kartı nəzərdə tutulur. AGBank Azərbaycanda&nbsp; plastic kartlar&nbsp; sahəsində yeniliklər gətirərərk bu g&uuml;n m&uuml;ştərilərinə Visa Gift, MasterCard Signia,Visa İnfinite, Master Card Virtual, MasterCard Euro kimi ekskl&uuml;ziv plastic məhsullar təklif edir.</span></p>\r\n<p><span lang="AZ-LATIN">AGBankın AGClub komplekti sahiblərinin d&uuml;nyanın istənilən yerində əmtəə və xidmətlərinin nağdsız &ouml;dənişini inamla və təhl&uuml;kəsiz aparmaları, AGClub endirim sisteminə&nbsp; daxil olan ticarət-servis m&uuml;əssisələrində endirimlərdən istifadə etmələri və səyahətə &ccedil;ıxarkən &ouml;zlərini m&uuml;dafıə olunmuş hiss etmələri &uuml;&ccedil;&uuml;n bankın iş&ccedil;iləri hər g&uuml;n durmadan &ccedil;alışır.</span></p>', 71, 'az', 1, 1),
