(3, 'Kampaniyalar', 286, 'http://localhost/agclub/az/companies', 0, 122, '<p><span style="font-family: ''Tahoma'',''sans-serif'';">Əziz AGClub kart istifadə&ccedil;iləri,</span></p>\r\n<p><span style="font-family: ''Tahoma'',''sans-serif'';">AGClub </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">Novruz bayramı</span><span style="font-family: ''Tahoma'',''sans-serif'';"> ilə əlaqədar olaraq </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">19</span><span style="font-family: ''Tahoma'',''sans-serif'';">-</span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">21 mart </span><span style="font-family: ''Tahoma'',''sans-serif'';">ərəfəsində </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="EN-US">L</span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">IST</span><span style="font-family: ''Tahoma'',''sans-serif'';">, </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="EN-US">HUGO </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="EN-US">BOSS</span><span style="font-family: ''Tahoma'',''sans-serif'';">, </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="EN-US">Kira </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="EN-US">Plastinina </span><span style="font-family: ''Tahoma'',''sans-serif'';">mağazalar şəbəkəsində 2</span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">5</span><span style="font-family: ''Tahoma'',''sans-serif'';">% </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">endirim </span><span style="font-family: ''Tahoma'',''sans-serif'';">kampaniyasını </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">elan edir</span><span style="font-family: ''Tahoma'',''sans-serif'';">! Beləliklə, AGClub kart sahiblərinə yuxarıda qeyd olunan mağazalarda b&uuml;t&uuml;n məhsullara 2</span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">5</span><span style="font-family: ''Tahoma'',''sans-serif'';">% endirim təklif edilir, kartı olmayan m&uuml;ştərilərə isə </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">bu</span><span style="font-family: ''Tahoma'',''sans-serif'';"> mağazalar şəbəkəsində alış-veriş edərək pulsuz AGClub endirim kartı əldə edəcəklər! </span><span style="font-family: ''Tahoma'',''sans-serif'';" lang="AZ-LATIN">&Ouml;z&uuml;n&uuml;z&uuml; və yaxınlarınızı</span><span style="font-family: ''Tahoma'',''sans-serif'';"> sevindirmək &uuml;&ccedil;&uuml;n f&uuml;rsəti qa&ccedil;ırmayın.</span></p>\r\n<p><span style="font-family: ''Tahoma'',''sans-serif'';">AGBank &ndash; zəngin olmaq haqqınızdır!</span></p>', 22, 'az', 1, 7),
