(1, 'MasterCard Virtual', 310, NULL, 0, 130, '<p style="text-align: justify;">İnternetdə xidmət və malların &ouml;dənilməsi &uuml;&ccedil;&uuml;n nəzərdə tutulur. Bu kart bizim kart sahiblərimizi internet şəbəkəsində dələduzluqdan qorumaq &uuml;&ccedil;&uuml;n yaradılıb. Kartın hesabında g&ouml;zlənilən alış-verişlər &uuml;&ccedil;&uuml;n tələb olan məbləğdə vəsait saxlamaq lazımdır. Bundan sonra hesab sıfıra enir və ona g&ouml;rə də kredit kartlarının n&ouml;mrələrini əldə etmək &uuml;&ccedil;&uuml;n x&uuml;susi saytları yaradan dələduzlar &uuml;&ccedil;&uuml;n bu kartlar he&ccedil; bir maraq kəsb etmir.</p>', 29, 'az', 0, 7),
