(1, 'Visa Electron', 313, NULL, 0, 131, '<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n</ul>\r\n<p style="text-align: justify;">"Pay now" tipli kartlar debet kartlarıdır və m&uuml;ştəriyə yalnız hesabda olan məbləğdə &ouml;dənişləri etməyə imkan verirlər. Bu kartlar 100% avtorizasiya ke&ccedil;irilən yerlərdə qəbul edilirlər, yəni ATM, POS elektron terminallarında. Bu kartlarla oteli rezervasiya etmək, maşını icarəyə g&ouml;t&uuml;rmək m&uuml;mk&uuml;n deyil, &ccedil;&uuml;nki bu xidmətlər kreditlə g&ouml;stərilir. Ehtimal edilir ki, bu səviyyəli kartda Sheraton tipli mehmanxanalarda yaşamaq &uuml;&ccedil;&uuml;n vəsait ola bilməz. Elektron kartı indi faktiki olaraq onu &ouml;dəməyə imlanı olan hər kəs a&ccedil;a bilər. Visa Electron kartını Visa loqotipli mağaza və bankomatlarda qəbul edilirlər. Bu kartlar &ouml;z xərclərinə nəzarət etməyə adət edən və bank hesabları ilə əməliyyatları maksimim dərəcədə təhl&uuml;kəsiz etmək arzusunda olanlar &uuml;&ccedil;&uuml;n rahat vasitədir.</p>', 30, 'az', 0, 7),
(1, NULL, 314, NULL, 0, 131, NULL, 30, 'ru', 0, 7),
(1, NULL, 315, NULL, 0, 131, NULL, 30, 'en', 0, 7),
(1, 'MasterCard Standard Euro', 322, NULL, 0, 134, '<p style="text-align: justify;"><strong>MasterCard Euro Card</strong> - Avrozonada malların və xidmətlərin dəyərinin &ouml;dənilməsi &uuml;&ccedil;&uuml;n nəzərdə tutulub. Bu kart &uuml;zrə əməliyyatlar və silinmələr Avro-da aparılır ki, bu da &ccedil;ox sərfəli və əlverişlidir &ccedil;&uuml;nki bu zaman konvertasiyaya g&ouml;rə komisyon haqqı tutulmur.</p>\r\n<p style="text-align: justify;"><strong>MasterCard Standard Euro - Mass kartları:</strong></p>\r\n<ul style="text-align: justify;">\r\n<li>malların və xidmətlərin dəyərinin &ouml;dənilməsi</li>\r\n<li>nağd vəsaitlərin &ccedil;ıxarılması (bankomatlar və bankın kassası)</li>\r\n<li>mehmanxanalarda otaqların sifariş edilməsi</li>\r\n<li>avtomobillərin icarəyə g&ouml;t&uuml;r&uuml;lməsi</li>\r\n</ul>\r\n<p style="text-align: justify;">Bu kartlar "pay-later" kateqoriyasına aiddirlər, yəni kartların sahiblərinə əvvəl m&uuml;əyyən ticarət məntəqələrində və m&uuml;əyyən məbləğ m&uuml;qabilində xidmətlər g&ouml;stərilir, sonra isə onlar həmin xidmətlərin dəyərini &ouml;dəyirlər - mehmanxanalarda otaqların sifariş edilməsi, avtomobillərin icarəyə g&ouml;t&uuml;r&uuml;lməsi və s. Bu kartlar &uuml;&ccedil;&uuml;n nə yığımlar, nə plastikin təcili dəyişdirilməsi, nə də ki, nağd vəsaitlərin verilməsi nəzərdə tutulmur.</p>', 33, 'az', 0, 7),
(1, 'Cirrus Maestro', 319, NULL, 0, 133, '<ul style="text-align: justify;">\r\n<li>xidmət və malların &ouml;dənişi</li>\r\n<li>nağd pulun &ccedil;ıxarılması (ATM və bankın kassası)</li>\r\n</ul>\r\n<p style="text-align: justify;"><strong>Maestro</strong> kartları "pay now" tipli debit kartlarıdır və m&uuml;ştəriyə yalnız hesabda olan məbləğdə &ouml;dənişlər etməyə imkan verirlər.<br /> Yalnız 100% avtorizasiya olan yerlərdə (ATM, POS elektron terminalları) qəbul edilirlər. <br /> Bu kartlarla oteli rezervasiya etmək, maşını icarəyə g&ouml;t&uuml;rmək olmaz, &ccedil;&uuml;nki bu xidmətlər kreditlə g&ouml;stərilir. <br /> Ehtimal olunur ki, bu səviyyəli kartda olan vəsait Sheraton klasslı mehmanxanalarda yaşayışı &ouml;dəmək &uuml;&ccedil;&uuml;n kifayət edə bilməz. <br /> Maestro kartını Maestro loqotipi olan mağaza və bankomatlarda qəbul edəcəklər. <br /> Bu kartlar xərclərinə nəzarət etməyə vərdiş edən və bank hesabları ilə əməliyyatları maksimum dərəcədə təhl&uuml;kəsiz etmək istəyənlər &uuml;&ccedil;&uuml;n əlverişlidir.</p>', 32, 'az', 0, 7),
