(1, 'Standard GBP', 451, NULL, 0, 177, '<p><span>AGBank-ın GBP plastik kartı ilə B&ouml;y&uuml;k Britaniya və Şimali İrlandiya Birləşmiş Krallığına daxil b&uuml;t&uuml;n &ouml;lkələrdə &ouml;dənişlərinizi indi daha rahat edin.</span><br /><br /><span>Təhsilini B&ouml;y&uuml;k Britaniyanın təhsil ocaqlarında davam edənlər və ya krallığı gəzib, dolaşmaq həvəsində olan səyahət sevənlər &uuml;&ccedil;&uuml;n AGBank-dan yeni GBP plastik kartı! Bu kart sayəsində istər tələbə ol, istərsə turist alış-veriş zamanı konvertasiyaya ehtiyac qalmayacaq artıq. Əvəzində, konvertasiyada itirdiyiniz hər qəpiyi toplayıb əzizlərinizə suvenir ala bilərsiniz. Qeyd edək ki, yetkinlik yaşına &ccedil;atmamış olsa belə hər bir şəxs bu kartın sahibi ola bilər.&nbsp;</span><br /><span>Yeni GBP plastik kartının istifadə&ccedil;isi &ldquo;sms notification&rdquo;, &ldquo;internet banking&rdquo;, &ldquo;card to card&rdquo; kimi bank xidmətlərindən də yararlana biləcək.</span><br /><br /><span>Qeyd edək ki, nağdsız &ouml;dənişlər &uuml;&ccedil;&uuml;n he&ccedil; bir komissiya haqqı tutulmur.</span></p>', 75, 'az', 1, 73),
